import logo from "./logo.svg";
import "./App.css";
import NavBar from "./components/NavBar";
import Hero from "./components/Hero";
import Card from "./components/Card";

function App() {
  const profile = profile[0];
  return (
    <div>
      <NavBar />
      <Hero />
      <Card img={profile.avatar} />
      <Card />
      <Card />
      <Card />
    </div>
  );
}

export default App;
